INSERT INTO `departments` (`id`, `name`, `description`, `created_at`, `updated_at`) VALUES
(32, 'IT Department', 'An IT department, short for Information Technology department, is the division within an organization responsible for managing and maintaining its technology infrastructure, including hardware, software, networks, and systems, ensuring they function smoothly and securely. ', '2025-03-25 02:37:44', '2025-03-25 02:37:44'),
(33, 'Operations', 'The operations department is a critical function within an organization that manages and oversees the day-to-day activities and processes of the business, ensuring efficient and effective operations to meet organizational goals. ', '2025-03-27 06:16:31', '2025-04-23 02:28:49'),
(34, 'Human Resources', 'The HR department is responsible for managing employment-related tasks and issues and engaging the team.', '2025-03-31 02:06:29', '2025-03-31 02:06:29'),
(35, 'Finance', 'A finance department is a functional area within an organization responsible for managing all financial activities and resources, ensuring the company\'s financial health and stability. This includes budgeting, financial planning, accounting, financial reporting, and analysis, ultimately contributing to the organization\'s financial success and sustainability. ', '2025-05-06 01:35:03', '2025-05-06 01:35:03'),
(36, 'Motorpool', 'A motor pool department is a centralized unit, often within a larger organization like a city\'s public works department, responsible for managing and maintaining a fleet of vehicles and equipment. It ensures the efficient and safe operation of these assets through various functions, including maintenance, repairs, and record-keeping.', '2025-07-01 00:58:34', '2025-07-01 00:58:34');
